import React from "react";
// @material-ui/core components
import { makeStyles } from "@material-ui/core/styles";

// @material-ui/icons
import Chat from "@material-ui/icons/Chat";
import VerifiedUser from "@material-ui/icons/VerifiedUser";
// core components
import GridContainer from "components/Grid/GridContainer.js";
import GridItem from "components/Grid/GridItem.js";
import InfoArea from "components/InfoArea/InfoArea.js";

import styles from "assets/jss/material-kit-react/views/landingPageSections/productStyle.js";

const useStyles = makeStyles(styles);

export default function DetailsSection() {
  const classes = useStyles();
  return (
    <div className={classes.section}>
      <GridContainer justify="center">
        <GridItem xs={12} sm={12} md={8}>
          <h2 className={classes.title}>Carnaby Rosedale</h2>
          <h5 className={classes.description}>Things to know</h5>
        </GridItem>
      </GridContainer>
      <div>
        <GridContainer>
          <GridItem xs={12} sm={12} md={4}>
            <InfoArea
              title="Free Chat"
              description="Introducing the Rosedale, a unique and special three bed retreat
              that has been thoughtfully designed to evoke a cosy and traditional
              cottage feel. With its clear division of living areas, the Rosedale
              boasts a flexible space, whether you’re holidaying as part of a
              couple or with family and friends."
              icon={Chat}
              iconColor="info"
              vertical
            />
          </GridItem>
          <GridItem xs={12} sm={6} md={4}>
            <InfoArea
              title="Verified Users"
              description="The sumptuous living area is
              divine, with a plump and lengthy plush sofa that’s perfectly
              positioned next to the gorgeous full-length windows, creating the
              perfect spot for a summer laze. A beautiful feature fireplace is the
              icing on the cake for those cooler evenings in, creating a welcoming
              and snug environment to relax or entertain."
              icon={VerifiedUser}
              iconColor="success"
              vertical
            />
          </GridItem>
        </GridContainer>
      </div>
    </div>
  );
}
